import { Routes, Route, Link } from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>PoopSwatch.com</p>
        <Routes>
          <Route path="/" element={<p>yes</p>} />
          <Route path="about" element={<p>maybe</p>} />
      </Routes>
      </header>
    </div>
  );
}

export default App;
